import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
    <h1>Welcome to React</h1>
    <h2>Login</h2>
            <input name="username" type="text" placeholder="username" /><br/><br/>
            <input name="password"  type="password" placeholder="password"  /><br/><br/>
            <input type="button"  value="Login" /><br/><br/>
    </div>
  );
}

export default App;
